import React from 'react';
import { Route, Switch, Redirect, Link } from "react-router-dom";

class Login extends React.Component {

  render(){
    return (
      <div className="login">
        <form>
          <h1>Welcome</h1>
          <label>
            E-mail:
            <input type="text" name="email"/>
          </label>
          <label>
            password:
            <input type="text" name="password"/>
          </label>
        </form>
      </div>
    );
  }
}

export default Login;
